@lilly-chen I think you modified the wrong file. You should check in lib/python3.7/site-packages/tensorflow/python/framework/ops.py which is the correct name of the variable. I assume it should be `core_tf_types.Tensor`, according to your comment.

Then, you should modify the function 'is_tensor' in  file /anaconda3/lib/python3.7/site-packages/keras/backend/tensorflow_backend.py in
```
def is_tensor(x):
     return isinstance(x, core_tf_types.Tensor) or tf_ops.is_dense_tensor_like(x)
```
Note, you should import core_tf_types as well. So, check in ops.py how it is imported, then add the same import statement at the top of tensorflow_backend.py. It should be something like this
`from tensorflow.core import something as core_tf_types`

Seems like some TF versions have the attribute defined in ops.py, while others import it from core.

