A recent commit (https://github.com/tensorflow/tensorflow/commit/cb221de8a4ef7d11bf980efa038efb72ec07161b) results in BLAS calls within certain unit tests getting routed to "ThenBlasGemmStridedBatched" API routine.  Those unit tests started failing on the ROCm platform, because that BLAS call was not supported for complex types. @ekuznetsov139 has added support for the same in the ROCm TF fork, and this PR is to upstream that support.

Please review and approve.

@whchung @chsigg @cheshire @nvining-work

